import {
  showRenewHistory
} from '../actions/actions'

class GetRequest {
  static getHistory() {
    return (dispatch) => {
      fetch('https://jsonplaceholder.typicode.com/todos/1')
        .then((response) => response.json())
        .then((json) => console.log(json))
      dispatch(showRenewHistory(response.data))

    }
  }
}

export default GetRequest
